import React from 'react';

function PaymentPage() {
  return (
    <div className="payment-page">
      <h2>Payment</h2>
      <p>Payment integration goes here. You can add a payment gateway form or redirect to a third-party payment processor.</p>
    </div>
  );
}

export default PaymentPage;
